import React from 'react';
import DeleteIcon from '@material-ui/icons/Delete';

const Listc = (props) =>{
    return  (
    <div className="todo_style">
    <span>
        <DeleteIcon/>
    </span>
    <li> {props.text}</li>
    </div>
    
    );
}

export default Listc;
